webpackJsonp([8549084590327],{502:function(a,e){a.exports={data:{allShareJson:{edges:[{node:{id:"2f0a723b-2772-40bf-9edc-70dd70337f10",slug:"facebook",name:"Facebook",url:"https://www.facebook.com/sharer/sharer.php?u=%POSTURL%;display=popup",width:626,height:457}},{node:{id:"f5678f7f-ae05-444a-af1a-1167a30d0cce",slug:"linkedin",name:"LinkedIn",url:"https://www.linkedin.com/shareArticle?mini=true&amp;url=%POSTURL%&amp;title=",width:600,height:450}},{node:{id:"4cbf0a18-d389-4583-98ac-501e59f1be18",slug:"twitter",name:"Twitter",url:"https://twitter.com/share?url=%POSTURL%&amp;text=",width:500,height:550}}]},markdownRemark:{html:'<blockquote>\n    This is a repost of my [original post](https://x-team.com/2013/11/25-awesome-tools-every-developer-should-have/) on [X-Team](https://x-team.com/) blog. I\'m putting it here for consistency.\n</blockquote>\n<!-- more -->\n<p>Most developers have a list somewhere (sometimes just in their heads) of favorite applications they use every day. In X-Team, every hero has his own list as well, and I\'d like to share with you the most common tools on those lists.</p>\n<h2><a href="https://www.iterm2.com/">iTerm</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/iTerm-93a7fc85d71dc62162dc29866d6ededb-3adf4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 423px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.57446808510638%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="iTerm"\n        title=""\n        src="/static/iTerm-93a7fc85d71dc62162dc29866d6ededb-3adf4.png"\n        srcset="/static/iTerm-93a7fc85d71dc62162dc29866d6ededb-c4d35.png 200w,\n/static/iTerm-93a7fc85d71dc62162dc29866d6ededb-87a5b.png 400w,\n/static/iTerm-93a7fc85d71dc62162dc29866d6ededb-3adf4.png 423w"\n        sizes="(max-width: 423px) 100vw, 423px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Like it or not, terminal is the most important developer tool. It makes doing a lot of tasks way easier and faster than GUI. As somebody said: "GUI makes easy tasks trivial, and hard tasks impossible to make." So learn to love your terminal, and it\'ll thank you later.</p>\n<h2><a href="https://brew.sh/">homebrew</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/brew-fdbc03a95e74b83e0b6df4c0cdc66c6a-3adf4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 423px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.57446808510638%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="homebrew"\n        title=""\n        src="/static/brew-fdbc03a95e74b83e0b6df4c0cdc66c6a-3adf4.png"\n        srcset="/static/brew-fdbc03a95e74b83e0b6df4c0cdc66c6a-c4d35.png 200w,\n/static/brew-fdbc03a95e74b83e0b6df4c0cdc66c6a-87a5b.png 400w,\n/static/brew-fdbc03a95e74b83e0b6df4c0cdc66c6a-3adf4.png 423w"\n        sizes="(max-width: 423px) 100vw, 423px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>A package manager for OSX. Think of it as <a href="https://en.wikipedia.org/wiki/Advanced_Packaging_Tool"><code class="language-text">apt-get</code></a> for Mac. It was written by the guys who had enough of MacPorts and decided to do it better. And they did - brew shines everywhere where MacPorts fails, starting from logical directory structure, through simple packaging system (everything is git based) to great simplicity of the tool itself.</p>\n<h2><a href="https://github.com/robbyrussell/oh-my-zsh">oh-my-zsh</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/oh-my-zsh-d88802d082129644d6db43f2b6d26ccb-3adf4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 423px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.57446808510638%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="oh-my-zsh"\n        title=""\n        src="/static/oh-my-zsh-d88802d082129644d6db43f2b6d26ccb-3adf4.png"\n        srcset="/static/oh-my-zsh-d88802d082129644d6db43f2b6d26ccb-c4d35.png 200w,\n/static/oh-my-zsh-d88802d082129644d6db43f2b6d26ccb-87a5b.png 400w,\n/static/oh-my-zsh-d88802d082129644d6db43f2b6d26ccb-3adf4.png 423w"\n        sizes="(max-width: 423px) 100vw, 423px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>A very nice addition to zsh shell - it comes bundled with a ton of helpful functions, helpers, plugins and themes. Want to see your current git branch in your shell prompt? You got it. RVM version? No problem. Weather? You bet. And still, it has ZShell under it, so it comes along with a nice path completion, history browsing and ton of other stuff.</p>\n<h2><a href="https://beyondgrep.com/">ack</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/ack-cc25a894642e61ca62f7d27f2c680540-3adf4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 423px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.57446808510638%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ack"\n        title=""\n        src="/static/ack-cc25a894642e61ca62f7d27f2c680540-3adf4.png"\n        srcset="/static/ack-cc25a894642e61ca62f7d27f2c680540-c4d35.png 200w,\n/static/ack-cc25a894642e61ca62f7d27f2c680540-87a5b.png 400w,\n/static/ack-cc25a894642e61ca62f7d27f2c680540-3adf4.png 423w"\n        sizes="(max-width: 423px) 100vw, 423px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>This is how grep would look like if it was created 20 years later; a great, blazing fast tool for finding contents of the file. And it is written with developers in mind, which means (for example), you can narrow results of the search only to the source files of the language you prefer. Or ignore VCS files. Or use regular expressions out of the box. This is a find-in-file Swiss Army Knife.</p>\n<h2><a href="https://rvm.io/">rvm</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/rvm-3447c4b362bfaab6ca569e5add50462c-3adf4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 423px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.57446808510638%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="rvm"\n        title=""\n        src="/static/rvm-3447c4b362bfaab6ca569e5add50462c-3adf4.png"\n        srcset="/static/rvm-3447c4b362bfaab6ca569e5add50462c-c4d35.png 200w,\n/static/rvm-3447c4b362bfaab6ca569e5add50462c-87a5b.png 400w,\n/static/rvm-3447c4b362bfaab6ca569e5add50462c-3adf4.png 423w"\n        sizes="(max-width: 423px) 100vw, 423px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>A tool no Ruby developer can live without. RVM is a command-line gadget which allows you to easily install, manage, and work with multiple Ruby environments from interpreters to sets of gems. Recently, Ruby experienced a thing called "fragmentation hell." There are two major versions of it, two major versions of its biggest framework (Hey! Rails! I\'m talking about you!), and a lot of concurrent gems. RVM helps you to catch up with all of that, and manage Ruby/Rails projects more efficiently.</p>\n<h2><a href="https://gruntjs.com/">Grunt</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/grunt-9dfd7b48484d2549509897a2de388e8c-3adf4.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 423px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 59.57446808510638%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Grunt"\n        title=""\n        src="/static/grunt-9dfd7b48484d2549509897a2de388e8c-3adf4.png"\n        srcset="/static/grunt-9dfd7b48484d2549509897a2de388e8c-c4d35.png 200w,\n/static/grunt-9dfd7b48484d2549509897a2de388e8c-87a5b.png 400w,\n/static/grunt-9dfd7b48484d2549509897a2de388e8c-3adf4.png 423w"\n        sizes="(max-width: 423px) 100vw, 423px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>This is a tool that our front-end guys love. It\'s a JavaScript task runner. It takes all the repeatable tasks off your shoulders. Thanks to its huge plugins database, it can minify CSS/JS files, compress images, compile LESS/SASS scripts, lint your source and even set a live-preview server for you. All in an easy-to-use JavaScript environment.</p>\n<h2><a href="https://www.alfredapp.com/">Alfred 2</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-c23a1508771778aaf9f6f0e4491c35f3-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 36.774193548387096%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Alfred 2"\n        title=""\n        src="/static/alfred-c23a1508771778aaf9f6f0e4491c35f3-fe114.png"\n        srcset="/static/alfred-c23a1508771778aaf9f6f0e4491c35f3-a941f.png 200w,\n/static/alfred-c23a1508771778aaf9f6f0e4491c35f3-9acbb.png 400w,\n/static/alfred-c23a1508771778aaf9f6f0e4491c35f3-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Alfred is a task launcher, designed to find files and operate on them quickly and easily. The application itself doesn\'t differ much from Spotlight, and careful reader may ask, what is the advantage of it.</p>\n<p>That\'s where <a href="https://www.alfredapp.com/powerpack/">Powerpack</a> kicks in. It enables things called "workflows." And workflows are huge advantage - think of them as Alfred on steroids. They are community written extensions which allows the base app to do almost everything. And there are <a href="https://bit.ly/2NB2AdD">hundreds</a> of them. Below is the short list of the ones we are using in X-Team.</p>\n<h3><a href="https://github.com/willfarrell/alfred-caniuse-workflow">Can I Use...</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-caniuse-a17430aba30e9403700732a4a9f70932-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.483870967741932%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Can I Use..."\n        title=""\n        src="/static/alfred-caniuse-a17430aba30e9403700732a4a9f70932-fe114.png"\n        srcset="/static/alfred-caniuse-a17430aba30e9403700732a4a9f70932-a941f.png 200w,\n/static/alfred-caniuse-a17430aba30e9403700732a4a9f70932-9acbb.png 400w,\n/static/alfred-caniuse-a17430aba30e9403700732a4a9f70932-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Full <a href="https://caniuse.com/">caniuse.com</a> database under your fingertips. No extra browsing needed.</p>\n<h3><a href="https://github.com/TylerEich/Alfred-Extras/tree/master/Source/Colors">Colors</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-colors-a7ab1061c4f02e02212da911f6beea8b-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.064516129032256%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Colors"\n        title=""\n        src="/static/alfred-colors-a7ab1061c4f02e02212da911f6beea8b-fe114.png"\n        srcset="/static/alfred-colors-a7ab1061c4f02e02212da911f6beea8b-a941f.png 200w,\n/static/alfred-colors-a7ab1061c4f02e02212da911f6beea8b-9acbb.png 400w,\n/static/alfred-colors-a7ab1061c4f02e02212da911f6beea8b-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Great tool for front-end developers. It converts colors between RGB, HSL and hexadecimal format. But the true power is the integration with color picker. By simply typing <code class="language-text">#</code> it allows you to choose any pixel from your desktop, and then Colors will automatically return hex/rgb/hsl values for it, ready to be copied or pasted.</p>\n<h3><a href="https://github.com/willfarrell/alfred-dash-workflow">Dash</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-dash-4fa8394f5a547c5d881700fd7c118ab6-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.483870967741932%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Dash"\n        title=""\n        src="/static/alfred-dash-4fa8394f5a547c5d881700fd7c118ab6-fe114.png"\n        srcset="/static/alfred-dash-4fa8394f5a547c5d881700fd7c118ab6-a941f.png 200w,\n/static/alfred-dash-4fa8394f5a547c5d881700fd7c118ab6-9acbb.png 400w,\n/static/alfred-dash-4fa8394f5a547c5d881700fd7c118ab6-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Allows you to browse <a href="https://kapeli.com/dash">Dash</a> docsets database way faster. More about Dash, below.</p>\n<h3><a href="https://github.com/ajgon/alfred2-datauri">Data URI Scheme</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-datauri-8feb87e794a55a0fb74e1220e8e821b7-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 24.193548387096772%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Data URI Scheme"\n        title=""\n        src="/static/alfred-datauri-8feb87e794a55a0fb74e1220e8e821b7-fe114.png"\n        srcset="/static/alfred-datauri-8feb87e794a55a0fb74e1220e8e821b7-a941f.png 200w,\n/static/alfred-datauri-8feb87e794a55a0fb74e1220e8e821b7-9acbb.png 400w,\n/static/alfred-datauri-8feb87e794a55a0fb74e1220e8e821b7-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Another front-end dev tool. It can convert any given file to its representation in base64 data uri scheme. And for image and vector files it also does compression on the fly.</p>\n<h3><a href="https://github.com/cdraeger/alfred2-flushdns-workflow">Flush DNS cache</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-flush-7f28d6c27f1e6dcc79f78e2b9dcbd69b-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 24.193548387096772%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Flush DNS cache"\n        title=""\n        src="/static/alfred-flush-7f28d6c27f1e6dcc79f78e2b9dcbd69b-fe114.png"\n        srcset="/static/alfred-flush-7f28d6c27f1e6dcc79f78e2b9dcbd69b-a941f.png 200w,\n/static/alfred-flush-7f28d6c27f1e6dcc79f78e2b9dcbd69b-9acbb.png 400w,\n/static/alfred-flush-7f28d6c27f1e6dcc79f78e2b9dcbd69b-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Mac OS X can be very stubborn sometimes when it comes to adding new entries to <code class="language-text">/etc/hosts</code>. This little extension is an excellent solution.</p>\n<h3><a href="https://github.com/ajgon/alfred2-html-entity-lookup">HTML Entity Lookup</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-entity-6bef6b80f0c4fea0fdb4f921b8e35915-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.483870967741932%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="HTML Entity Lookup"\n        title=""\n        src="/static/alfred-entity-6bef6b80f0c4fea0fdb4f921b8e35915-fe114.png"\n        srcset="/static/alfred-entity-6bef6b80f0c4fea0fdb4f921b8e35915-a941f.png 200w,\n/static/alfred-entity-6bef6b80f0c4fea0fdb4f921b8e35915-9acbb.png 400w,\n/static/alfred-entity-6bef6b80f0c4fea0fdb4f921b8e35915-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Alfred version of Remy\'s Sharp <a href="https://leftlogic.com/projects/entity-lookup/">excellent tool</a> - it allows the user to quickly find the entity based on how it looks.</p>\n<h3><a href="https://github.com/superkam/iOS_Simulator_Kit">iOS Simulator Kit</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-ios-e4a7206483d6ecaf0168d3fbc297cfa6-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 36.774193548387096%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="iOS Simulator Kit"\n        title=""\n        src="/static/alfred-ios-e4a7206483d6ecaf0168d3fbc297cfa6-fe114.png"\n        srcset="/static/alfred-ios-e4a7206483d6ecaf0168d3fbc297cfa6-a941f.png 200w,\n/static/alfred-ios-e4a7206483d6ecaf0168d3fbc297cfa6-9acbb.png 400w,\n/static/alfred-ios-e4a7206483d6ecaf0168d3fbc297cfa6-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>For some reason, Alfred and Spotlight search results don\'t include iOS Simulator application in their results. With this workflow - it\'s not an issue anymore. Also, you can choose with device you wish to emulate from the very beginning.</p>\n<h3><a href="https://github.com/DavidStaron/alfred-workflow-stripClipboardFormatting">Strip clipboard</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-sclip-0f6334901642b35ab91b2af88f3074ec-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 24.193548387096772%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Strip clipboard"\n        title=""\n        src="/static/alfred-sclip-0f6334901642b35ab91b2af88f3074ec-fe114.png"\n        srcset="/static/alfred-sclip-0f6334901642b35ab91b2af88f3074ec-a941f.png 200w,\n/static/alfred-sclip-0f6334901642b35ab91b2af88f3074ec-9acbb.png 400w,\n/static/alfred-sclip-0f6334901642b35ab91b2af88f3074ec-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>This is one of the tools, that when installed - you can\'t live without them. It strips all the formatting from the clipboard content, leaving only raw text inside.</p>\n<h3><a href="https://github.com/zhaocai/alfred2-sourcetree-workflow">Source Tree</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-stree-3a4a29da8986393b52aaeb93dca93627-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.483870967741932%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Source Tree"\n        title=""\n        src="/static/alfred-stree-3a4a29da8986393b52aaeb93dca93627-fe114.png"\n        srcset="/static/alfred-stree-3a4a29da8986393b52aaeb93dca93627-a941f.png 200w,\n/static/alfred-stree-3a4a29da8986393b52aaeb93dca93627-9acbb.png 400w,\n/static/alfred-stree-3a4a29da8986393b52aaeb93dca93627-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>As the name suggests - it\'s a workflow for SourceTree application. It lists all the repositories and allows you to view them in Source Tree or in Finder.</p>\n<h3><a href="https://www.alfredforum.com/topic/491-timezones-a-world-clock-script-filter-updated-to-v161/">TimeZones</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-tz-1146cfe28bd813a38f6fe04215b99b32-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 24.193548387096772%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="TimeZones"\n        title=""\n        src="/static/alfred-tz-1146cfe28bd813a38f6fe04215b99b32-fe114.png"\n        srcset="/static/alfred-tz-1146cfe28bd813a38f6fe04215b99b32-a941f.png 200w,\n/static/alfred-tz-1146cfe28bd813a38f6fe04215b99b32-9acbb.png 400w,\n/static/alfred-tz-1146cfe28bd813a38f6fe04215b99b32-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>X-Team is spread around the globe. Most of the projects are handled simultaneously by developers from different timezones. This extension is a great tool to check if someone on the team is awake yet :)</p>\n<h3><a href="https://www.dropbox.com/s/51pyuuj051pydn2/VirtualBox.alfredworkflow">VirtualBox Control</a></h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/alfred-vm-371961a76722b9da0ac3f90da1bd5464-fe114.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 620px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.483870967741932%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="VirtualBox Control"\n        title=""\n        src="/static/alfred-vm-371961a76722b9da0ac3f90da1bd5464-fe114.png"\n        srcset="/static/alfred-vm-371961a76722b9da0ac3f90da1bd5464-a941f.png 200w,\n/static/alfred-vm-371961a76722b9da0ac3f90da1bd5464-9acbb.png 400w,\n/static/alfred-vm-371961a76722b9da0ac3f90da1bd5464-fe114.png 620w"\n        sizes="(max-width: 620px) 100vw, 620px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Very useful extension for a QA team. They usually have a few VMs configured (mostly for IE8, IE9 and IE10) - and with this extension they can manage them faster.</p>\n<h2><a href="https://www.sublimetext.com/">Sublime Text</a> <a href="https://www.sublimetext.com/2">2</a> (or <a href="https://www.sublimetext.com/3">3</a>)</h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sublime-4b20e6b0272d4fc8e1d0a6f22b683851-6783e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 427px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.421545667447305%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Sublime Text"\n        title=""\n        src="/static/sublime-4b20e6b0272d4fc8e1d0a6f22b683851-6783e.png"\n        srcset="/static/sublime-4b20e6b0272d4fc8e1d0a6f22b683851-43b7d.png 200w,\n/static/sublime-4b20e6b0272d4fc8e1d0a6f22b683851-31e91.png 400w,\n/static/sublime-4b20e6b0272d4fc8e1d0a6f22b683851-6783e.png 427w"\n        sizes="(max-width: 427px) 100vw, 427px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>This is the editor of choice for most X-Team developers, and for <a href="https://net.tutsplus.com/articles/news/perfect-workflow-in-sublime-text-free-course/">a lot of other people too</a>. It is not language-oriented, like most of the IDEs, but it\'s irreplaceable when it comes to using multiple syntaxes.</p>\n<p>And since most of web developers constantly switch between HTML, CSS, JavaScript and PHP/Ruby - Sublime shines. Oh! And it\'s written in Python so it\'s blazing fast (yes, Java, I\'m talking to you...). But the real power of ST are the plugins - they are for almost everything, so if you invest some time at the beginning - you will end with the editor tailored exactly for your needs. And that\'s a field, where no other editor (except of vim and emacs of course) can compete. Here is an excerpt of the long list of plugins, which X-devs use:</p>\n<ul>\n<li><a href="https://sublime.wbond.net/">Package Control</a> (a must have!)</li>\n<li><a href="https://github.com/skuroda/Sublime-AdvancedNewFile">AdvancedNewFile</a></li>\n<li><a href="https://github.com/facelessuser/ApplySyntax">ApplySyntax</a></li>\n<li><a href="https://github.com/facelessuser/BracketHighlighter">BracketHighlighter</a></li>\n<li><a href="https://github.com/csscomb/CSScomb-for-Sublime">CSSComb</a></li>\n<li><a href="https://github.com/Warin/Sublime/tree/master/DocBlockr">DocBlockr</a></li>\n<li><a href="https://github.com/sindresorhus/editorconfig-sublime">EditorConfig</a></li>\n<li><a href="https://github.com/sergeche/emmet-sublime">Emmet</a></li>\n<li><a href="https://github.com/jisaacks/GitGutter">GitGutter</a></li>\n<li><a href="https://github.com/benmatselby/sublime-phpcs">Phpcs</a></li>\n<li><a href="https://wbond.net/sublime_packages/prefixr">Prefixr</a></li>\n<li><a href="https://github.com/titoBouzout/SideBarEnhancements">Sidebar Enchancements</a></li>\n<li><a href="https://sublimecodeintel.github.io/SublimeCodeIntel/">SublimeCodeIntel</a></li>\n<li><a href="https://github.com/SublimeLinter/SublimeLinter">SublimeLinter</a></li>\n</ul>\n<p>... and many more.</p>\n<h2><a href="https://kapeli.com/dash">Dash</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dash-0d78919f7e56711cdaff8e46ae60282b-07d32.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 72.75862068965517%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Dash"\n        title=""\n        src="/static/dash-0d78919f7e56711cdaff8e46ae60282b-07d32.png"\n        srcset="/static/dash-0d78919f7e56711cdaff8e46ae60282b-df058.png 200w,\n/static/dash-0d78919f7e56711cdaff8e46ae60282b-e78bb.png 400w,\n/static/dash-0d78919f7e56711cdaff8e46ae60282b-07d32.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>A very nice tool which can be a lifesaver on a plane, bus or any place where you want to work that has no Internet available. It\'s  an offline documentation database. Simply download docsets you need, and you\'re good to go. Integrates nicely with Alfred and Sublime Text, as mentioned earlier.</p>\n<h2><a href="https://mizage.com/divvy/">Divvy</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/divvy-99749a3d5b8607d59f91a736d65b83a9-1d2f1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 320px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 87.5%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Divvy"\n        title=""\n        src="/static/divvy-99749a3d5b8607d59f91a736d65b83a9-1d2f1.png"\n        srcset="/static/divvy-99749a3d5b8607d59f91a736d65b83a9-f09be.png 200w,\n/static/divvy-99749a3d5b8607d59f91a736d65b83a9-1d2f1.png 320w"\n        sizes="(max-width: 320px) 100vw, 320px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>A simple click and drag window manager. Very useful on iMacs, which have a huge working space and you can confortably work with many windows on one desktop. It is also a very simple application, which does exactly what it\'s designed for very well - aligning windows, and assigning shortcuts for them.</p>\n<h2><a href="https://bit.ly/2LHGpkd">FontPrep</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/fontprep-04d57abb11c4bb9b89447acba114de33-1f3ca.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 550px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 43.63636363636364%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="FontPrep"\n        title=""\n        src="/static/fontprep-04d57abb11c4bb9b89447acba114de33-1f3ca.png"\n        srcset="/static/fontprep-04d57abb11c4bb9b89447acba114de33-dea60.png 200w,\n/static/fontprep-04d57abb11c4bb9b89447acba114de33-7f974.png 400w,\n/static/fontprep-04d57abb11c4bb9b89447acba114de33-1f3ca.png 550w"\n        sizes="(max-width: 550px) 100vw, 550px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Drag your font into it, click export and you will end up with your font converted to four of the most used formats on the web (otf, ttf, woff and eot) and a CSS file with @font-face directives. Beautiful.</p>\n<h2><a href="https://imageoptim.com/">ImageOptim</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/imageoptim-2839ed1c8f54201ca76480b658ebeedd-6783e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 427px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.421545667447305%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="ImageOptim"\n        title=""\n        src="/static/imageoptim-2839ed1c8f54201ca76480b658ebeedd-6783e.png"\n        srcset="/static/imageoptim-2839ed1c8f54201ca76480b658ebeedd-43b7d.png 200w,\n/static/imageoptim-2839ed1c8f54201ca76480b658ebeedd-31e91.png 400w,\n/static/imageoptim-2839ed1c8f54201ca76480b658ebeedd-6783e.png 427w"\n        sizes="(max-width: 427px) 100vw, 427px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Image files generated by graphics programs (such as Photoshop or GIMP), can be huge. The reason is that they add alot of unnecessary data and they handle color and alpha management poorly.</p>\n<p><strong>ImageOptim</strong> is a solution for that - it comes bundled with many image-optimization tools (like pngcrush for PNG or jpegtran for JPG), compresses an image with each of them, and returns the best result. It saves 30-40% of image space on average - which is a huge improvement, especially today, for graphically overloaded sites.</p>\n<h2><a href="https://bit.ly/2PluIl5">Marked</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/marked-3ac70394d06f471adf4d9c2a3a2e36a2-6783e.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 427px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 60.421545667447305%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Marked"\n        title=""\n        src="/static/marked-3ac70394d06f471adf4d9c2a3a2e36a2-6783e.png"\n        srcset="/static/marked-3ac70394d06f471adf4d9c2a3a2e36a2-43b7d.png 200w,\n/static/marked-3ac70394d06f471adf4d9c2a3a2e36a2-31e91.png 400w,\n/static/marked-3ac70394d06f471adf4d9c2a3a2e36a2-6783e.png 427w"\n        sizes="(max-width: 427px) 100vw, 427px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>MarkDown documents viewer. Great, when you need to edit a *.md file in your favorite editor (for example Sublime Text, with which it integrates smoothly) and see the live preview.</p>\n<h2><a href="https://www.sourcetreeapp.com/">SourceTree</a></h2>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/sourcetree-fda70e6b2023202561d0f3f37d081336-7ac59.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 640px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.9375%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SourceTree"\n        title=""\n        src="/static/sourcetree-fda70e6b2023202561d0f3f37d081336-7ac59.png"\n        srcset="/static/sourcetree-fda70e6b2023202561d0f3f37d081336-589b6.png 200w,\n/static/sourcetree-fda70e6b2023202561d0f3f37d081336-1e1b1.png 400w,\n/static/sourcetree-fda70e6b2023202561d0f3f37d081336-7ac59.png 640w"\n        sizes="(max-width: 640px) 100vw, 640px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>There are to ways of using git. Conservatives use terminal. New-age programmers use GUI tools. And the most popular GUI for git in our company is SourceTree.</p>\n<p>Why? It\'s free and it supports gpg commits signing, which is vital in our environment. It also has what all good, modern VCS GUI should have, like branch view, diff view, git flow and interactive rebase.</p>\n<h2>Wrap-up</h2>\n<p>While it is intelligent to choose multiple tools for speeding up the development process, it\'s essential for you to avoid embracing all of them. The act will not only burden your system, but also create confusion and you may discover not using most of them.</p>\n<p>If you\'ve got better tools, please share them with us! Also do share with us your secret tips on organizing your development more efficiently.</p>',
excerpt:"Most developers have a list somewhere (sometimes just in their heads) of favorite applications they use every day. In X-Team, every hero has",frontmatter:{title:"25 awesome tools every developer should have",date:"November 13, 2013",cover:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.3333333333333333,src:"/static/25-awesome-tools-every-developer-should-have-81d768e1371479f7887a3bf24c0035e8-75c44.jpg",srcSet:"/static/25-awesome-tools-every-developer-should-have-81d768e1371479f7887a3bf24c0035e8-d1f5d.jpg 250w,\n/static/25-awesome-tools-every-developer-should-have-81d768e1371479f7887a3bf24c0035e8-6d1fa.jpg 500w,\n/static/25-awesome-tools-every-developer-should-have-81d768e1371479f7887a3bf24c0035e8-75c44.jpg 1000w,\n/static/25-awesome-tools-every-developer-should-have-81d768e1371479f7887a3bf24c0035e8-c2ca0.jpg 1024w",sizes:"(max-width: 1000px) 100vw, 1000px"}}},path:"/blog/25-awesome-tools-every-developer-should-have",author:"Igor Rzegocki"}}},pathContext:{}}}});
